    // xử lý cập nhật sub product
    handleSubProduct(value) {
        if (this.formSubProduct.valid) {
            if (value.hasOwnProperty('allow_sell')) {
                value = { delete_hidden: !value.allow_sell };
            }
            let data = Object.assign(Object.assign({}, value), { warning_number: value.warning_number >= 0 ? parseFloat(value.warning_number) : null, price: this.price_size.getRawValue() ? parseFloat(this.price_size.getRawValue()) : 0, price2: this.management_product_price2 && this.price2_size.getRawValue() ? parseFloat(this.price2_size.getRawValue()) : 0, price_import: this.price_size_purchase.getRawValue() ? parseFloat(this.price_size_purchase.getRawValue()) : 0 });
            let dataUpdate = {};
            let subUpdate = this.subProducts.filter(f => f._id == data._id)[0];
            if (data.name != subUpdate.name)
                dataUpdate['name'] = data.name;
            if (data.warning_number != subUpdate.warning_number)
                dataUpdate['warning_number'] = data.warning_number;
            data.units[0]['price_import'] = data.price_import;
            data.units[0]['price'] = data.price;
            data.units[0]['price2'] = data.price2;
            data.units[0]['barcode'] = data.barcode;
            dataUpdate['units'] = [
                ...data.units
            ];
            if (data.manylot != subUpdate.manylot)
                dataUpdate['manylot'] = data.manylot;
            if (data['manylot']) {
                dataUpdate['lots'] = data.lots;
                dataUpdate['days_import_warning'] = data.days_import_warning;
                dataUpdate['days_exp_warning'] = data.days_exp_warning;
            }
            this.vhQuerySales.updateSubProduct(subUpdate._id, dataUpdate).then((bool) => {
                if (bool) {
                    const index = this.subProducts.findIndex(f => f._id == data._id);
                    this.subProducts = this.subProducts.filter(f => f._id != data._id);
                    this.subProducts.splice(index, 0, data);
                }
                else {
                    this.vhComponent.alertMessageDesktop("error", 'Cập nhật thất bại, vui lòng thử lại !');
                }
            }, error => {
                this.vhComponent.alertMessageDesktop("error", error);
            });
            this.handleCancelSubProduct();
        }
    }
